--
-- Table structure for table `qu_member_profiles`
--

DROP TABLE IF EXISTS `qu_member_profiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qu_member_profiles` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '系统编号',
  `mid` int(11) NOT NULL COMMENT '商家ID',
  `avatar` varchar(255) NOT NULL DEFAULT 'https://websocketcom.github.io/logo/kaadon/icon_128x128.png' COMMENT '头像',
  `account_main` tinyint(4) NOT NULL DEFAULT '1' COMMENT '主账号:{1:"email",2:"mobile"}',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(64) DEFAULT '' COMMENT '手机',
  `realname` varchar(20) DEFAULT NULL COMMENT '姓名',
  `nickname` varchar(20) DEFAULT NULL COMMENT '昵称',
  `country` varchar(32) DEFAULT NULL COMMENT '区',
  `province` varchar(32) DEFAULT NULL COMMENT '省',
  `city` varchar(32) DEFAULT NULL COMMENT '市',
  `county` varchar(32) DEFAULT NULL COMMENT '区',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(11) DEFAULT NULL COMMENT '删除时间',
